import React from "react";

export default function App() {
  return (
    <nav>
      <ul>
        <li><a href="aboutMe">About Me</a></li>
        <li><a href="portfolio">Portfolio</a></li>
        <li><a href="#contact">Contact</a></li>
        <li><a href="#resume">Resume</a></li>
      </ul>
    </nav>
  );
}
